    /**
     * 根据路径获取图片的Base64
     *
     * @param path
     * @return
     */
    public String getImageBase64(String path) {
        String stringBase64 = null;
        try {
            File file = new File(path);
            if (file != null && file.exists()) {
                FileInputStream fis = new FileInputStream(file);
                try {
                    byte[] fileBytes = new byte[fis.available()];
                    fis.read(fileBytes);
                    stringBase64 = Base64.getEncoder().encodeToString(fileBytes);
                } catch (Exception e) {
                    e.printStackTrace();
                } finally {
                    fis.close();
                }
            }
        } catch (Exception ex) {
            LOG.error("获取图片的base64失败：" + ex.getMessage());
        }
        return stringBase64;
    }

